"""-------------------------------------------------------------------------------------------------------
MODULE
    ContextEditor
    
    (c) Copyright 2009-2016 by SunGard Front Arena. All rights reserved.

VERSION
    3.3.0

DESCRIPTION
    With the ContextEditor it is possible to create copies of and edit contexts

USAGE
    RunScriptCMD.py ContextEditor --Source=Standard --copy=True --destination=CopyOfStandard

    <!-- Copy a context -->
    <Command module="ContextEditor">
        <source>Standard</source>
        <copy>true</copy>
        <destination>CopyOfStandard</destination>
    </Command>

    RunScriptCMD.py ContextEditor --apply_modules="Default,REMod,%org,%group,%user" --Source=CopyOfStandard

    <!-- Set modules in context -->
    <Command module="ContextEditor">
        <source>CopyOfStandard</source>
        <apply_modules>Default,REMod,%org,%group,%user</apply_modules>
    </Command>

    RunScriptCMD.py ContextEditor --context=CopyOfStandard --remove_module="REMod" --add_module=BOMod --add_before=%org

    <!-- Dynamically alter context -->
    <Command module="ContextEditor">
        <context>CopyOfStandard</context>
        <remove_module>REMod</remove_module>
        <add_module>BOMod</add_module>
        <add_before>%org</add_before> <!-- add_after has precedence -->
    </Command>

    RunScriptCMD.py ContextEditor --delete_context=CopyOfStandard
    
    <!-- Delete a context -->
    <Command module="ContextEditor">
        <delete_context>CopyOfStandard</delete_context>
    </Command>

     
MAJOR REVISIONS
    2009-05-01  RL  Initial implementation
    2011-02-09  RL  Add support for Compound modules in 2011.1
    2011-05-13  RL  Added usage examples
-------------------------------------------------------------------------------------------------------"""
